import { Question } from "./components/Question.js";
import { QuestionNavbar } from "../QuestionNavbar.js";

export const Study15 = () => {
  return (
    <div className="questions">
      <QuestionNavbar />
      <Question
        title={
          "Kun juttu on julkaistu, millaista keskustelua uskot tekemäsi jutun tuottavan?​​​​"
        }
        options={[
          { value: "Kontekstoimalla jutun harkitusti​​", navigate: "study/12" },
          { value: "Käyttämällä vastuullisesti kerronnan keinoja​​", navigate: "study/13" },
          { value: "Tarkistamalla tiedot mahdollisimman hyvin​​​", navigate: "study/14" },
        ]}
      />
    </div>
  );
};
